import Navbar from "./Navbar";
import "./style/Home.css";
import minion from "./img/minion.png";

function Home() {
  return (
    <div className="Home">
      <div className="Wrap-Home">
        <div className="Wrap-Title">
          <p className="Error">Assalamualaikum</p>
          <h1 className="Title-Home">Hey Reza</h1>
          <br></br>
          <p className="Text">
            Apa yang mau cari disini ? Ini <br></br>hanya hasil untuk MiniApp!
          </p>
          <div className="Wrap-Button">
            <button className="Button-Profile">
              <a href="/profile" className="Button">
                Hasil MiniApp
              </a>
            </button>
          </div>
        </div>
        <img src={minion} alt="Minions" className="Minion" />
      </div>
    </div>
  );
}

export default Home;
